import './App.css';

function App() {
  const firstName = "First Name";
  const lastname = "Last Name";
  const currentDate = new Date().toLocaleDateString();
  const currentTime = new Date().toLocaleTimeString();
  // const time = new Time();
  return (
      <div className="App">
        <h1>Demo One | {firstName} {lastname}</h1>
        <p>Today day is: <strong>{currentDate}</strong></p>
        <p>Current Time is: <strong>{currentTime}</strong></p>
      </div>
  );
}

export default App;

